export const nakedSingle = {
  name: "Naked Single",
  check: (cell) => {
    let report = new Map();

    // if this cell has only one suspect...
    if (cell.suspects.size === 1) {
      // ...report that suspect's value.
      report.set([cell.row, cell.col], cell.suspects.values().next().value);

      return {
        report: report,
        solution: val,
      };
    }
    return null;
  },
};
